class MetaTileEntityAntimatterGenerator(metaTileEntityId: ResourceLocation?) : FuelMultiblockController(metaTileEntityId, ANTIMATTER_GENERATOR_FUELS, MAX)
{

    init
    {
        recipeMapWorkable = AntimatterGeneratorWorkableHandler(this)
        recipeMapWorkable.maximumOverclockVoltage = VOC[MAX_TRUE] // Long.MAX_VALUE
    }

    companion object
    {
        private val casingState
            get() = GTLiteMetaBlocks.METAL_CASING_03.getState(BlockMetalCasing03.MetalCasingType.QUANTUM_ALLOY)
        private val secondCasingState
            get() = GTLiteMetaBlocks.MULTIBLOCK_CASING_01.getState(BlockMultiblockCasing01.MultiblockCasingType.GRAVITY_STABILIZATION_CASING)
        private val thirdCasingState
            get() = GTLiteMetaBlocks.MULTIBLOCK_CASING_01.getState(BlockMultiblockCasing01.MultiblockCasingType.ADVANCED_FILTER_CASING)

        private val coilState
            get() = GTLiteMetaBlocks.MULTIBLOCK_CASING_01.getState(BlockMultiblockCasing01.MultiblockCasingType.ANTIMATTER_ANNIHILATION_MATRIX)
        private val secondCoilState
            get() = GTLiteMetaBlocks.MULTIBLOCK_CASING_01.getState(BlockMultiblockCasing01.MultiblockCasingType.PROTOMATTER_ACTIVATION_COIL)

        private val glassState
            get() = GTLiteMetaBlocks.TRANSPARENT_CASING_01.getState(BlockGlassCasing01.GlassType.ANTIMATTER_CONTAINMENT)
    }

    override fun createMetaTileEntity(tileEntity: IGregTechTileEntity) = MetaTileEntityAntimatterGenerator(metaTileEntityId)

    override fun initializeAbilities()
    {
        super.initializeAbilities()
        val outputEnergy = ArrayList(getAbilities(OUTPUT_ENERGY))
        outputEnergy.addAll(getAbilities(SUBSTATION_OUTPUT_ENERGY))
        outputEnergy.addAll(getAbilities(OUTPUT_LASER))
        energyContainer = EnergyContainerList(outputEnergy)
    }

